import './App.css';
import Footer from "./components./Footer"
function App() {
  return (
    <div>
      <nav>
        <h1>Hello</h1>
        <ul>
          <li>1</li>
          <li>2</li>
          <li>3</li>
        </ul>
      </nav>
      <main>
        <h1>this is where most of my contents go</h1>
      </main>
      <Footer />
   </div>
  );
}

export default App;
